    // Initialize the map
    var map = new mapboxgl.Map({
      container: 'map',
      style: 'mapbox://styles/mapbox/streets-v11',
      center: [0, 0],
      zoom: 1
    });



    // Add points to the map
    map.on('load', function() {
      map.addSource('points', {
        type: 'geojson',
        data: {
          type: 'FeatureCollection',
          features: data.map(function(point) {
            return {
              type: 'Feature',
              geometry: {
                type: 'Point',
                coordinates: [point.location.lon, point.location.lat]
              },
              properties: {
                color: point.color,
                id: point.id,
                timestamp: point.timestamp,
                title: point.title
              }
            };
          })
        },
        cluster: true,
        clusterMaxZoom: 14, // Max zoom level at which clusters are shown
        clusterRadius: 50 // Radius of each cluster when clustering points
      });

      map.addLayer({
        id: 'clusters',
        type: 'circle',
        source: 'points',
        filter: ['has', 'point_count'],
        paint: {
          'circle-radius': [
            'step',
            ['get', 'point_count'],
            20, // Radius of the cluster circles
            100, // Zoom level at which the circles should start to appear
            30, // Radius of the cluster circles
            750, // Zoom level at which the circles should appear at full size
            40 // Radius of the cluster circles
          ],
          'circle-color': '#006d2c' // Color of the cluster circles
        }
      });

      map.addLayer({
        id: 'cluster-count',
        type: 'symbol',
        source: 'points',
        filter: ['has', 'point_count'],
        layout: {
          'text-field': '{point_count_abbreviated}',
          'text-font': ['Arial Unicode MS Bold'],
          'text-size': 14
        },
        paint: {
          'text-color': '#99d8c9' // Color of the cluster count numbers
        }
      });

      map.addLayer({
        id: 'unclustered-point',
        type: 'circle',
        source: 'points',
        filter: ['!', ['has', 'point_count']],
        paint: {
          'circle-radius': 5,
          'circle-color': ['get', 'color']
        }
      });

      // Zoom on click for clusters
      map.on('click', 'clusters', function(e) {
        var features = map.queryRenderedFeatures(e.point, { layers: ['clusters'] });
        var clusterId = features[0].properties.cluster_id;
        map.getSource('points').getClusterExpansionZoom(clusterId, function(err, zoom) {
          if (err) return;

          map.easeTo({
            center: features[0].geometry.coordinates,
            zoom: zoom
          });
        });
      });

      // Change the cursor style to pointer on hover for clusters
      map.on('mouseenter', 'clusters', function() {
        map.getCanvas().style.cursor = 'pointer';
      });

      // Change the cursor style back to default on mouse leave for clusters
      map.on('mouseleave', 'clusters', function() {
        map.getCanvas().style.cursor = '';
      });
    });
  </script>
